import './contact.scss';

function Contact() {
  return (
    <div className="contact">
      <h1>Contact me</h1>
      <form>
        <div>
          <input type="text" />
          <button>Send</button>
        </div>
        <textarea rows="8" />
      </form>
    </div>
  );
}

export default Contact;
